import React from 'react'

const useStyles = makeStyles((theme) => ({
    navbar: {
        //flexGrow: 1,
        height: "100%",
        background: "#E0E0E0",
        width: "10%",
        position: "fixed",
        paddingTop: "2%"
    },
    button: {
        marginBottom: "20px",
        background: "white",
        width: "100px",
        height: "100px",
        marginLeft: "auto",
        marginRight: "auto",
        textAlign: "center",
        borderRadius: 15,
        verticalAlign: "center",
        padding: "10px",

    },
    icon: {
        margin: "auto",
        fontSize: "5em",
        marginBottom: "0px",
        verticalAlign: "middle",
        fill: '#730099',
        //fontFamily: "sans-serif",
        //marginTop: "20px"
    },
    buttonLabel: {
        fontSize: "1.5em",
        margin: "0",

    },
    wrapper: {
		display: "grid",
        gridGap: "10px",
		gridTemplateColumns: "100px 100px 100px",
		backgroundColor: "#fff",
		color: "#444",
	},

	box: {
		backgroundColor: "#444",
		color: "#fff",
		borderRadius: "5px",
		padding: "20px",
		fontSize: "150%",

	}
}));

function BoardComponent() {
    const classes = useStyles();
    return (
        <div class="wrapper">
		<div class="box a">A</div>
		<div class="box b">B</div>
		<div class="box c">C</div>
		<div class="box d">D</div>
		<div class="box e">E</div>
		<div class="box f">F</div>
	</div>
    )
}

export default BoardComponent
